
DROP TABLE IF EXISTS `air_table`;

CREATE TABLE `air_table` (
  `air_table_id` int NOT NULL PRIMARY KEY AUTO_INCREMENT, 
  `account` VARCHAR(6) NOT NULL, 
  `surname` VARCHAR(30) NOT NULL, 
  `firstname` VARCHAR(30) NOT NULL, 
  `category_code` VARCHAR(2), 
  `address1` VARCHAR(50), 
  `address2` VARCHAR(50), 
  `address3` VARCHAR(50), 
  `current_trainer_num` VARCHAR(10), 
  `active` TINYINT(1), 
  `post_direct` TINYINT(1), 
  `hri_account_holder` TINYINT(1), 
  `hri_acc_num` VARCHAR(50), 
  INDEX (`account`), 
  INDEX (`hri_acc_num`)
) ENGINE=myisam DEFAULT CHARSET=utf8;

SET autocommit=1;

